export default class App extends React.Component {
  constructor() {
    super()
    console.log("test")
  }

  render() {

    let title = "Dit is de front-end van de Game API"

    return (
      <div className="App">
        <Header />
        <Footer />
        <GameDex />
      </div>
    )
  }
}
